import React, { Component } from "react";

class Track extends Component {
	
	
	render () {
		return (
			<div style={{position: "relative", border: "solid 1px black", width: "10%", left: "5%", top: "30%" }}>
				<p>Song</p>
			</div>	
		);
	}
}

export default Track;
